using System.Data.SqlTypes;
using System.Text.RegularExpressions;
using Microsoft.SqlServer.Types;
using Nin;
using Nin.Common;
using NUnit.Framework;

namespace Test.Unit.Common
{
    public class CoordinateSystemConverterTest
    {
        [Test]
        public void ConvertPointTest()
        {
            var actual = Reproject("POINT(150.555 -10.666)");
            Assert.AreEqual("POINT (502340.88 -10.70)", actual);
        }

        [Test]
        public void ConvertEmptyPointTest()
        {
            var actual = Reproject("POINT EMPTY");
            Assert.AreEqual("POINT EMPTY", actual);
        }

        [Test]
        public void ConvertMultiPointTest()
        {
            var actual = Reproject("MULTIPOINT((10 40), (40 30), (20 20), (30 10))");
            Assert.AreEqual("MULTIPOINT ((502200.70 40.16), (502230.62 30.12), (502210.67 20.08), (502220.65 10.04))", actual);
        }

        [Test]
        public void ConvertEmptyMultiPointTest()
        {
            var actual = Reproject("MULTIPOINT EMPTY");
            Assert.AreEqual("MULTIPOINT EMPTY", actual);
        }

        [Test]
        public void ConvertLineStringTest()
        {
            var actual = Reproject("LINESTRING(30 10, 31 11, 32 12)");
            Assert.AreEqual("LINESTRING (502220.65 10.04, 502221.65 11.04, 502222.64 12.04)", actual);
        }

        [Test]
        public void ConvertEmptyLineStringTest()
        {
            var actual = Reproject("LINESTRING EMPTY");
            Assert.AreEqual("LINESTRING EMPTY", actual);
        }

        [Test]
        public void ConvertMultiLineStringTest()
        {
            var actual = Reproject("MULTILINESTRING((10 10, 20 20, 10 40), (40 40, 30 30, 40 20, 30 10))");
            Assert.AreEqual("MULTILINESTRING ((502200.70 10.04, 502210.67 20.08, 502200.70 40.16), (502230.62 40.16, 502220.65 30.12, 502230.62 20.08, 502220.65 10.04))", actual);
        }

        [Test]
        public void ConvertEmptyMultiLineStringTest()
        {
            var actual = Reproject("MULTILINESTRING EMPTY");
            Assert.AreEqual("MULTILINESTRING EMPTY", actual);
        }

        [Test]
        public void ConvertPolygonTest()
        {
            var actual = Reproject("POLYGON((150 -10, 150 110, 250 110, 250 -10, 150 -10))");
            Assert.AreEqual("POLYGON ((502340.33 -10.04, 502340.33 110.44, 502440.06 110.44, 502440.06 -10.04, 502340.33 -10.04))", actual);
        }

        [Test]
        public void ConvertEmptyPolygonTest()
        {
            var actual = Reproject("POLYGON EMPTY");
            Assert.AreEqual("POLYGON EMPTY", actual);
        }

        [Test]
        public void ConvertComplexPolygonTest()
        {
            var actual = Reproject("POLYGON((35 10, 45 45, 15 40, 10 20, 35 10),(20 30, 35 35, 30 20, 20 30))");
            Assert.AreEqual("POLYGON ((502225.63 10.04, 502235.61 45.18, 502205.69 40.16, 502200.70 20.08, 502225.63 10.04), (502210.67 30.12, 502225.63 35.14, 502220.65 20.08, 502210.67 30.12))", actual);
        }

        [Test]
        public void ConvertMultiPolygonTest()
        {
            var actual = Reproject("MULTIPOLYGON (((40 40, 20 45, 45 30, 40 40)),((20 35, 10 30, 10 10, 30 5, 45 20, 20 35),(30 20, 20 15, 20 25, 30 20)))");
            Assert.AreEqual("MULTIPOLYGON (((502230.62 40.16, 502210.67 45.18, 502235.61 30.12, 502230.62 40.16)), ((502210.67 35.14, 502200.70 30.12, 502200.70 10.04, 502220.65 5.02, 502235.61 20.08, 502210.67 35.14), (502220.65 20.08, 502210.67 15.06, 502210.67 25.10, 502220.65 20.08)))", actual);
        }

        [Test]
        public void ConvertEmptyMultiPolygonTest()
        {
            var actual = Reproject("MULTIPOLYGON EMPTY");
            Assert.AreEqual("MULTIPOLYGON EMPTY", actual);
        }

        [Test]
        public void ConvertGeometryCollectionTest()
        {
            var actual = Reproject("GEOMETRYCOLLECTION(POINT(4 6), LINESTRING(4 6, 7 10))");
            Assert.AreEqual("GEOMETRYCOLLECTION (POINT (502194.72 6.02), LINESTRING (502194.72 6.02, 502197.71 10.04))", actual);
        }

        [Test]
        public void ConvertEmptyGeometryCollectionTest()
        {
            var actual = Reproject("GEOMETRYCOLLECTION EMPTY");
            Assert.AreEqual("GEOMETRYCOLLECTION EMPTY", actual);
        }

        [Test]
        public void ConvertPointUnknownEpsgCodeTest()
        {
            Assert.Throws<CoordinateSystemConverterException>(
                delegate
                {
                    const int invalidEpsgCode = 999999;
                    Reproject("POINT(150.555 -10.666)", DefaultSourceSrid, invalidEpsgCode);
                });
        }

