        private static string Reproject(string sqlText, int sourceSrid = DefaultSourceSrid, int targetEpsgCode = DefaultTargetSrid)
        {
            SqlGeometry sqlGeometry = StGeomFromText(sqlText, sourceSrid);
            var converted = new MapProjection(targetEpsgCode).Reproject(sqlGeometry);
            Assert.True(converted.STIsValid().Value);
            var geometryString = converted.ToString();
            var actual = TruncateNumbersTo2Decimals(geometryString);
            return actual;
        }

        private static string TruncateNumbersTo2Decimals(string geometryString)
        {
            Regex truncate = new Regex(@"(\d*\.\d{0,2})\d*");
            return truncate.Replace(geometryString, "$1");
        }

        private static SqlGeometry StGeomFromText(string sqlString, int srid)
        {
            var sqlGeometry = SqlGeometry.STGeomFromText(new SqlChars(sqlString), srid);
            Assert.True(sqlGeometry.STIsValid().Value);
            return sqlGeometry;
        }

        private const int DefaultSourceSrid = 25832; // ETRS89 / UTM zone 32N
        private const int DefaultTargetSrid = 3857; // WGS84 Web Mercator (Auxiliary Sphere), aka OpenLayers:900913, EPSG:3785 and EPSG:3857.
    }
